const Planeta = ({nome, tipo, ordem}) => {
    return (
        <>
            <h3>Nome: {nome}</h3>
            <h3>Tipo: {tipo}</h3>
            <h3>Ordem: {ordem}</h3>
        </>
    )
}

export default Planeta
